local self = {}GCompute.VariableReadPlan = GCompute.MakeConstructor (self)function self:ctor ()	self.VariableReadType = GCompute.VariableReadType.None	self.CachedLeft = nilendfunction self:GetVariableReadType ()	return self.VariableReadTypeendfunction self:SetVariableReadType (VariableReadType)	self.VariableReadType = VariableReadTypeendfunction self:ExecuteAsAST (astRunner, node, state)	-- Discard Identifier	astRunner:PopNode ()		if self.VariableReadType ~= GCompute.AssignmentType.NamespaceMember then error ("fail") end		if not self.CachedLeft then		self.CachedLeft = executionContext:GetRuntimeNamespace ()	end		astRunner:PushValue (self.CachedLeft [node:GetName ()])end